p_value_function = function(a, b) {
  print(paste("A: Mean",mean(a)," SD: ",sd(a)))
  print(paste("B: Mean",mean(b)," SD: ",sd(b)))
  
  constant_arrays = TRUE
  a_1 = a[1]
  b_1 = b[1]
  i = 2
  while (i <= 30 && constant_arrays) {
    if (!(a_1 == a[i] && b_1 == b[i])) {
      constant_arrays = FALSE
    }
    i = i + 1
  }
  if (constant_arrays) {
    #both arrays are constant, so t test won't work
    if (a_1 == b_1) {
      #all values in both arrays are constant - can't say one
      #is better than the other
      return (NA)
    } else if (a_1 < b_1) {
      #a has better makespans
      return (0)
    } else {
      #b has better makespans
      return (1)
    }
  } else {
    #alternative is that difference in means is greater than 0, meaning that 
    #a has higher values than b
    wilcox_test = wilcox.test(a,b,paired=FALSE,alternative = "g")
    return (wilcox_test$p.value)
  }
}

